deployment:
  containers:
  - env: []
    image: me-west1-docker.pkg.dev/minereye-delivery-public/minereye-services/dashboard-client:v3.6.2
    name: dashboard-client
    ports: []
    resources:
      requests:
        memory: 100Mi
  enabled: true
